  return (
    <div className='shoppingCard'>
      {/* <div className='shoppingCard__item'></div>*/}
      <div className='shoppingCard__details'>
        <h3>Men's Hoodie - light gray</h3>
        <span>$35,99</span>
        <div className='size'></div>
      </div>
    </div>
  );
}

